import React, { useEffect, useRef } from 'react';
import { Link } from 'react-router-dom';
import * as THREE from 'three';
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls';
import Atropos from 'atropos/react';
import './Home.css';

function Home() {
  const mount = useRef(null);
  const rendererRef = useRef(null);
  const globeRef = useRef(null);
  const nodesRef = useRef([]);
  const linesRef = useRef([]);
  const particlesRef = useRef([]);

  useEffect(() => {
    if (!mount.current) return;

    const scene = new THREE.Scene();
    const camera = new THREE.PerspectiveCamera(75, mount.current.clientWidth / mount.current.clientHeight, 0.1, 1000);
    const renderer = new THREE.WebGLRenderer({ antialias: true, alpha: true });

    rendererRef.current = renderer;

    renderer.setSize(mount.current.clientWidth, mount.current.clientHeight);
    renderer.setClearColor(0x000000, 0);
    mount.current.appendChild(renderer.domElement);

    // Create globe
    const globeGeometry = new THREE.SphereGeometry(1, 32, 32);
    const globeMaterial = new THREE.MeshPhongMaterial({
      color: 0x3a228a,
      transparent: true,
      opacity: 0.8,
    });
    globeRef.current = new THREE.Mesh(globeGeometry, globeMaterial);
    scene.add(globeRef.current);

    // Create nodes
    const nodeGeometry = new THREE.SphereGeometry(0.02, 16, 16);
    const nodeMaterial = new THREE.MeshBasicMaterial({ color: 0xffffff });

    for (let i = 0; i < 20; i++) {
      const node = new THREE.Mesh(nodeGeometry, nodeMaterial);
      const phi = Math.acos(-1 + (2 * i) / 20);
      const theta = Math.sqrt(20 * Math.PI) * phi;
      node.position.setFromSpherical(new THREE.Spherical(1.02, phi, theta));
      globeRef.current.add(node);
      nodesRef.current.push(node);
    }

    // Create lines
    const lineMaterial = new THREE.LineBasicMaterial({ color: 0x00ff00, transparent: true, opacity: 0.5 });

    for (let i = 0; i < nodesRef.current.length; i++) {
      for (let j = i + 1; j < nodesRef.current.length; j++) {
        if (Math.random() > 0.85) {
          const geometry = new THREE.BufferGeometry().setFromPoints([
            nodesRef.current[i].position,
            nodesRef.current[j].position,
          ]);
          const line = new THREE.Line(geometry, lineMaterial);
          globeRef.current.add(line);
          linesRef.current.push(line);
        }
      }
    }

    // Create particles
    const particleGeometry = new THREE.SphereGeometry(0.005, 8, 8);
    const particleMaterial = new THREE.MeshBasicMaterial({ color: 0xffff00 });

    for (let i = 0; i < linesRef.current.length; i++) {
      const particle = new THREE.Mesh(particleGeometry, particleMaterial);
      particle.position.copy(linesRef.current[i].geometry.attributes.position.array);
      globeRef.current.add(particle);
      particlesRef.current.push({
        mesh: particle,
        line: linesRef.current[i],
        progress: 0,
        speed: Math.random() * 0.002 + 0.001,
      });
    }

    // Lighting
    const ambientLight = new THREE.AmbientLight(0x404040);
    scene.add(ambientLight);

    const pointLight = new THREE.PointLight(0xffffff, 1, 100);
    pointLight.position.set(10, 10, 10);
    scene.add(pointLight);

    camera.position.z = 3;

    // Controls
    const controls = new OrbitControls(camera, renderer.domElement);
    controls.enableDamping = true;
    controls.dampingFactor = 0.05;
    controls.rotateSpeed = 0.5;

    // Animation
    const animate = () => {
      if (!mount.current) return;

      requestAnimationFrame(animate);

      globeRef.current.rotation.y += 0.002;

      particlesRef.current.forEach((particle) => {
        particle.progress += particle.speed;
        if (particle.progress > 1) particle.progress = 0;

        const positions = particle.line.geometry.attributes.position.array;
        const start = new THREE.Vector3(positions[0], positions[1], positions[2]);
        const end = new THREE.Vector3(positions[3], positions[4], positions[5]);
        particle.mesh.position.lerpVectors(start, end, particle.progress);
      });

      controls.update();
      renderer.render(scene, camera);
    };

    animate();

    const handleResize = () => {
      if (!mount.current || !rendererRef.current) return;

      camera.aspect = mount.current.clientWidth / mount.current.clientHeight;
      camera.updateProjectionMatrix();
      rendererRef.current.setSize(mount.current.clientWidth, mount.current.clientHeight);
    };

    window.addEventListener('resize', handleResize);

    return () => {
      window.removeEventListener('resize', handleResize);
      if (mount.current && rendererRef.current) {
        mount.current.removeChild(rendererRef.current.domElement);
      }
      if (rendererRef.current) {
        rendererRef.current.dispose();
      }
      // Dispose of other Three.js objects
      if (globeRef.current) {
        globeRef.current.geometry.dispose();
        globeRef.current.material.dispose();
      }
      nodesRef.current.forEach(node => {
        node.geometry.dispose();
        node.material.dispose();
      });
      linesRef.current.forEach(line => {
        line.geometry.dispose();
        line.material.dispose();
      });
      particlesRef.current.forEach(particle => {
        particle.mesh.geometry.dispose();
        particle.mesh.material.dispose();
      });
    };
  }, []);

  const services = [
    { icon: 'fas fa-cloud', name: 'Cloud Solutions', description: 'Optimize your business with cutting-edge cloud technologies.' },
    { icon: 'fas fa-shield-alt', name: 'Cybersecurity', description: 'Protect your digital assets with robust security measures.' },
    { icon: 'fas fa-robot', name: 'AI Integration', description: 'Leverage the power of AI to drive innovation and efficiency.' },
    { icon: 'fas fa-cogs', name: 'IT Consulting', description: 'Expert advice to align your IT strategy with business goals.' }
  ];

  return (
    <div className="home">
      <section className="hero">
        <div className="hero-content">
          <h1 className="fade-in-up">Innovative IT Solutions</h1>
          <p className="fade-in-up">Empowering businesses with cutting-edge technology</p>
          <Link to="/contact" className="btn fade-in-up">Get Started</Link>
        </div>
        <div className="hero-image fade-in-up">
          <div ref={mount} className="globe-visualization"></div>
        </div>
      </section>

      <section className="services">
        <h2 className="section-title fade-in-up">What I Do</h2>
        <div className="service-grid">
          {services.map((service, index) => (
            <Atropos
              key={index}
              className="service-card-wrapper"
              highlight={false}
              shadow={false}
            >
              <div className="service-card fade-in-up">
                <i className={`${service.icon} service-icon`} data-atropos-offset="5"></i>
                <h3 data-atropos-offset="4">{service.name}</h3>
                <p data-atropos-offset="3">{service.description}</p>
              </div>
            </Atropos>
          ))}
        </div>
      </section>

      <section className="about-snippet">
        <div className="container">
          <h2 className="section-title fade-in-up">Why Partner With Me</h2>
          <div className="about-grid">
            <div className="about-item fade-in-up">
              <i className="fas fa-rocket"></i>
              <h3>Innovative Solutions</h3>
              <p>I harness the latest tech to push your business forward.</p>
            </div>
            <div className="about-item fade-in-up">
              <i className="fas fa-shield-alt"></i>
              <h3>Robust Security</h3>
              <p>Your data's safety is a top priority with state-of-the-art security measures.</p>
            </div>
            <div className="about-item fade-in-up">
              <i className="fas fa-users"></i>
              <h3>Your Tech-Savvy Problem Solver</h3>
              <p>With years of hands-on experience, I bring industry insights and expertise to every project, delivering solutions you can count on.</p>
            </div>
          </div>
        </div>
      </section>

      <section className="cta">
        <div className="container">
          <h2 className="fade-in-up">Ready to Transform Your IT Infrastructure?</h2>
          <p className="fade-in-up">Let's discuss how we can elevate your business with our IT solutions.</p>
          <Link to="/contact" className="btn fade-in-up">Contact Me</Link>
        </div>
      </section>
    </div>
  );
}

export default Home;
